// Entry handler for screen class "MaJFichierScreen"
function onMaJFichierScreenEntry() {
	putInField(company, 34, 5, false);
	putInField(company, 34, 6, false);
	putInField(street, 34, 8, false);
	putInField(city, 34, 9, false);
	putInField(state, 34, 10, false);
	putInField(postalcode, 34, 11, false);
	//putInField(country, 40, 11, false);
	putInField(telephone, 34, 14, false);
	putInField(contact, 34, 16, false);
}

function putInField(data, col, lin, enter) {
	javelin.moveCursor(col, lin);
	javelin.doAction("KEY_ERASEEOF");
	if(data != "")
		javelin.send(data);
	if (enter) {
		javelin.doAction("KEY_ENTER");
		javelin.waitForDataStable(timeout, threshold);
	}
}

