// Handles the XML generated event.
function onXmlGenerated() {
	// XPath for the searched element
	var myXPath = "//NOM[. = 'MINT']";
	// Locate the element that contains our XPath
	var tmpEl = Packages.org.apache.xpath.XPathAPI.selectNodeIterator(dom.getDocumentElement(), myXPath).nextNode();
	// Extract the selected <row>
	if (tmpEl != null) {
		var rowEl = tmpEl.getParentNode();
		var delEl = rowEl.getParentNode().removeChild(rowEl);
	}
}

function putInField(data, col, lin, enter) {
